import React, { Component } from 'react';
import img from './utilities/images/homes';


export class test extends Component {

  state = {
    path: img + "/homesFive.jpg",
}

  render() {
    return (
      <div className="body-box"
      >
        <img 
          src={this.state.path}
          // src={img}
          alt='new' 
          style={{
            height: "200px",
            width: "200px",
            objectFit: "cover",
          }}
          />
      </div>
    )
  }
}

export default test
